import React from "react";
import "./App.css";
import { Container, Row, Col, ListGroup } from "react-bootstrap";

function App() {
  return (
    <Container fluid className="h-100">
      <Row className="h-100">
        {/* thanh công cụ */}
        <Col xs={2} className="border-right">
          <h3>Generals</h3>
          <ListGroup>
            <ListGroup.Item action>Rectangle</ListGroup.Item>
            <ListGroup.Item action> Circle</ListGroup.Item>
            <ListGroup.Item action>Vector</ListGroup.Item>
          </ListGroup>
        </Col>
        {/* khung làm việc */}
        <Col
          xs={8}
          className="d-flex align-items-center justify-content-center "
        >
          <canvas
            id="canvas"
            width="900"
            height="600"
            style={{ border: "1px solid black", backgroundColor: "white" }}
          ></canvas>
        </Col>
        {/* thanh thuộc tính */}
        <Col xs={2} className="border-left">
          <div id="textPropertites" style={{ display: "none" }}>
            <h3>Text Propertites</h3>
          </div>
        </Col>
      </Row>
    </Container>
  );
}

export default App;
